import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

function Login() {
  return (
    <>
        <h2>Login</h2>
      <Form.Control size="lg" type="text" name="" placeholder="Large text" />
      <br />
    </>
  );
}

export default Login;
